import React from 'react';
import './selected.css';

const selected = (props) => {
    const selected=props.selected;
    console.log(selected);
    return (
        <div className="Selected-Area">
            <h1>Selected</h1>
            <h3>Selected:{selected.length}</h3>
            <h4>Name: {selected.name}</h4>
        </div>
    );
};

export default selected;
